import React from "react";
import Todo from "./components/Todo";

class App extends React.Component {
  state = {
    Todo: [
      {
        id: 1,
        Title: "learn js",
        status: false
      },
      {
        id: 2,
        Title: "learn react js",
        status: false
      },
      {
        id: 3,
        Title: "learn react-native",
        status: false
      }
    ]
  };

  render() {
    return (
      <div className="App">
        <Todo />
      </div>
    );
  }
}
export default App;
